import { library } from "@fortawesome/fontawesome-svg-core";
import {
  faGithub,
  faLinkedin,
  faBehanceSquare,
  faDribbble,
} from "@fortawesome/free-brand-svg-icons";

const FontAwesome = () => {
  library.add(faGithub, faLinkedin, faBehanceSquare, faDribbble);
};

export default FontAwesome;
